import { SET_LOGIN_MODAL_WINDOW } from "../action-types";

const initialState = {
    loginPopup: false
}

const modals = (state = initialState, action) => {
  switch (action.type) {
    case SET_LOGIN_MODAL_WINDOW: {
      return {
          login
      }
    }
    default: {
      return state;
    }
  }
};

export default modals;
